CREATE OR REPLACE FUNCTION udf_NORMSDIST(x NUMERIC) RETURNS NUMERIC AS $$
       
DECLARE 
result NUMERIC;
L NUMERIC;
N NUMERIC;
dCND NUMERIC;
pi NUMERIC;
a1 NUMERIC;
a2 NUMERIC;
a3 NUMERIC;
a4 NUMERIC;
a5 NUMERIC;
 BEGIN
--SELECT L = 0.0
N := 0.0;
dCND := 0.0;

a1 := 0.31938153;
a2 := -0.356563782;
a3 :=  1.781477937;
a4 := -1.821255978;
a5 := 1.330274429;
pi := 3.1415926535897932384626433832795;

L := Abs(x);

IF L >= 30 THEN
IF sign(x) = 1 THEN
result := 1; 
ELSE
result := 0; 
END IF;
ELSE
-- perform calculation
N :=   1.0 / (1.0 + 0.2316419 * L);
dCND := 1.0 - 1.0 / Sqrt(2 * pi) * Exp(-L * L / 2.0) *
(a1 * N + a2 * N * N + a3 * POWER(N, 3.0) + a4 * POWER(N, 4.0) + a5 * POWER (N, 5.0)) ;
IF (x < 0) THEN
result := 1.0 - dCND;
ELSE
result := dCND;
END IF;
END IF;

RETURN result;
END;
$$ LANGUAGE plpgsql;


