	""RiskAnalysisID""
    ,""CreatedBy"" 
    ,""CreatedDate"" 
    ,""EquipmentNo""
    ,""COF""
    ,""C_POF""
    ,""C_Year"" 
	,""C_Risk""
	,""C_Priority""
	,""C_Financial""
	,""C_FinancialRisk""
	,""A_POF""
	,""A_Year"" 
	,""A_Risk""
	,""A_Priority""
	,""A_Financial""
	,""A_FinancialRisk""
)
SELECT 
""PipeMaster"".""PipeMasterID""
,'SYSADMIN'
,NOW()
,""PipeMaster"".""EquipmentNo""
,""PipeMaster"".""OverallCOF""
,""PipeMaster"".""OverallPOF""::INT
,""PipeMaster"".""AnalysisYear""
,""MST_RiskPriority"".""Risk""
,""MST_RiskPriority"".""Priority""
,""MST_RiskPriority"".""Financial""
,""MST_RiskPriority"".""Financial""
