,""NOM_DIA_D_INCHES""								
,""NOM_THK_NT_INCHES""							
,""DESIGN_TEMP_DEGF""								
,""DESIGN_PRESSURE_P_PSI""						
,""EFFECTIVE_CORROSION_RATE""						
,""MATERIAL_STD""									
,""MATERIAL_GRADE""								
,""INJECTION_POINTS_INTERMITENT""					
,""CORROSION_ALLOWANCE""							
,""VERY_HIGH""									
,""HIGH""											
,""MEDIUM""										
,""LOW""											
,""NO""											
,""LAST_MEASURED_THK_FOR_DIA_LMT""				
,""LAST_MEASURED_YEAR_FOR_DIA_LMY""				
,""YIELD_STRENGTH_KSI""							
,""TENSILE_STREGTH_KSI""									
