CREATE OR REPLACE PROCEDURE SP_UPD_POF_EC(I_EQUIPMENT_NO VARCHAR(25)
,I_PRESENT_YEAR NUMERIC
)
LANGUAGE plpgsql    
AS $BODY$ 

DECLARE 
